const seedTeams = async () => {
  try {
    // Connect to MongoDB
    const mongoURI = process.env.MONGODB_URI || `mongodb://${process.env.DB_HOST || 'localhost'}:${process.env.DB_PORT || 27017}/${process.env.DB_NAME}`;
    console.log(`Connecting to MongoDB at ${mongoURI}`);
    await mongoose.connect(mongoURI);
    console.log('Connected to MongoDB');

    // Clear existing teams
    await Team.deleteMany({});
    console.log('Cleared existing teams');

    // Create a demo admin user for createdUserId
    const demoAdminId = new mongoose.Types.ObjectId();

    // Insert sample teams
    const teamsWithUserId = sampleTeams.map(team => ({
      ...team,
      createdUserId: demoAdminId
    }));

    await Team.insertMany(teamsWithUserId);
    console.log(`Inserted ${sampleTeams.length} teams successfully`);

    // Disconnect
    await mongoose.disconnect();
    console.log('Disconnected from MongoDB');
  } catch (error) {
    console.error('Error seeding teams:', error);
    process.exit(1);
  }
};

// Run the seeder
if (require.main === module) {
  seedTeams();
}

module.exports = { seedTeams };
